import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { useSelector } from "react-redux";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import MainLayout from "./layouts/MainLayout";
import MainPage from "./pages/MainPage";
import InventoryPages from "./pages/InventoryPages";
import InventoryReceiving from "./pages/InventoryReceiving";
import InventoryShipping from "./pages/InventoryShipping";
import InventoryHistory from "./pages/InventoryHistory";
import Notice from "./pages/Notice";
import ProductPages from "./pages/ProductPages";
import ProductRegister from "./pages/ProductRegister";
import ProductManagement from "./pages/ProductManagement";
import ProductStockStatus from "./pages/ProductStockStatus";
import ProductCategoryRegister from "./pages/ProductCategoryRegister";
import RtMain from "./pages/RtMain";
import RtSearch from "./pages/RtSearch";
import RtRegister from "./pages/RtRegister";
import ChatHistory from "./pages/ChatHistory";
import ManagementStore from "./pages/ManagementStore";
import ManagementCode from "./pages/ManagementCode";
import MyPage from "./pages/MyPage";
import PrivateRoute from "./PrivateRoute";

const AppRouter = () => {
  return (
    <BrowserRouter>
      <Routes>
        {/* 처음 접속 시 로그인 페이지로 리다이렉트 */}
        <Route path="/" element={<Navigate to="/login" replace />} />

        {/* 인증이 필요 없는 라우트 */}
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />

        {/* 보호된 라우트 */}
        <Route element={<PrivateRoute />}>
          {/* MainLayout이 적용되는 라우트들 */}
          <Route
            path="/*"
            element={
              <MainLayout>
                <Routes>
                  <Route path="main" element={<MainPage />} />
                  <Route path="inventory/*" element={<InventoryPages />} />
                  <Route path="/inventory/receiving" element={<InventoryReceiving />} />
                  <Route path="/inventory/shipping" element={<InventoryShipping />} />
                  <Route path="/inventory/history" element={<InventoryHistory />} />
                  <Route path="notice/*" element={<Notice />} />
                  <Route path="product/*" element={<ProductPages />} />
                  <Route path="/product/register" element={<ProductRegister />} />
                  <Route path="/product/management" element={<ProductManagement />} />
                  <Route path="/product/stockstatus" element={<ProductStockStatus />} />
                  <Route path="/product/categoryregister" element={<ProductCategoryRegister />} />
                  <Route path="rt/*" element={<RtMain />}>
                    <Route path="search" element={<RtSearch />} />
                    <Route path="register" element={<RtRegister />} />
                  </Route>
                  <Route path="chat" element={<ChatHistory />} />
                  <Route path="management/*">
                    <Route path="store" element={<ManagementStore />} />
                    <Route path="code" element={<ManagementCode />} />
                  </Route>
                  <Route path="mypage" element={<MyPage />} />
                </Routes>
              </MainLayout>
            }
          />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default AppRouter;
